import React from "react";
import "./LandFooter.css";

function LandFooter() {
  return (
    <div id="footer">
      <a href="https://github.com/Vivek-Vardhan-K/BookTeleporter">
        <small>Github</small>
      </a>
      <span> </span>
      <a href="https://github.com/Vivek-Vardhan-K/BookTeleporter/blob/main/Documentation/How-to-use.md">
        <small>Documentation</small>
      </a>
    </div>
  );
}

export default LandFooter;
